import {kitData} from '../data/KITS_SHIPPING_DATA';
import axios from 'axios';

const kitDataApi = 'http://localhost:3000/kit_data'

export const getKitInfo = async() => {
    return axios.get(kitDataApi).then((res) => {
        const { data } = res || {};
        return data;
    });
}
